var tipuesearch = {"pages": [{'title': 'About', 'text': 'cmsimde_site \n', 'tags': '', 'url': 'About.html'}, {'title': 'VOCABULARY', 'text': '/downloads/cambridge_english_vocabulary_list.pdf \n /downloads/The_Oxford_5000.pdf \n', 'tags': '', 'url': 'VOCABULARY.html'}, {'title': 'chatGPT', 'text': 'Q:請問地球自轉的角速度是多少弧度/秒 \n ans: 地球自轉的角速度約為每秒 7.292 × 10^-5 弧度/秒。 \n Q:3弧度/秒平方的轉盤,半徑20公分,由靜止啟動,10秒內角速度是多少弧度/秒 \n ans: \n 根據轉動運動學的公式，轉動加速度a等於角加速度α乘以轉盤的半徑r，即a = αr。 \n 又因為轉盤由靜止啟動，所以初始角速度為0，因此可以使用下列公式計算轉盤在10秒後的角速度ω： \n ω = αt \n 其中t為時間，代入t=10秒，得到： \n ω = α × 10 \n 再將轉動加速度a和轉盤半徑r代入得到： \n a = αr \n α = a / r \n 因此，可以得到轉盤在10秒內的角速度ω： \n ω = α × 10 = (3 弧度/秒^2 × 10秒) / 0.2公尺 = 150 弧度/秒 \n 因為轉盤的半徑單位為公分，所以需要先轉換為公尺，這樣才能進行計算。最後得到的答案為150弧度/秒。 \n Q: 既上面 10秒內均角速度是多少弧度/秒\xa0 \n ans: \n 由於轉盤是由靜止啟動，因此初始角速度為0，最終角速度為ω，而轉動運動學中的均角速度（平均角速度）公式為： \n 均角速度 = 總角位移 / 總時間 \n 因為轉盤在10秒內均勻加速，因此可以使用等加速度運動的公式來計算轉盤在10秒內的總角位移θ： \n θ = 初始角速度 × 時間 + 1/2 × 角加速度 × 時間的平方 \n 其中，初始角速度為0，角加速度為3弧度/秒^2，時間為10秒，代入上述公式得： \n θ = 1/2 × 3弧度/秒^2 × (10秒)^2 = 150弧度 \n 因此，轉盤在10秒內的均角速度為： \n 均角速度 = 總角位移 / 總時間 = 150弧度 / 10秒 = 15弧度/秒 \n 因此，轉盤在10秒內的均角速度為15弧度/秒。 \n', 'tags': '', 'url': 'chatGPT.html'}, {'title': '考試介紹', 'text': '', 'tags': '', 'url': '考試介紹.html'}, {'title': 'TOEFL', 'text': '托福」測驗 (Test of English as a Foreign Language, TOEFL®)由美國教育測驗服務社(Educational Testing Service, ETS®) 在全世界舉辦。托福測驗測試母語非英語者之英語能力，如果您想申請入學美加地區大學或研究所，「托福」成績單將可能是必備文件之一。 「托福」網路測驗(TOEFL iBT®)是經由網際網路方式進行，測驗項目包含：閱讀(Reading)、聽力(Listening)、口說(Speaking) 及寫作(Writing)。每項分數30分，總分120分。每個項目至少需作答一題才計分，寫作以打字方式完成。 \n', 'tags': '', 'url': 'TOEFL.html'}, {'title': 'GRE', 'text': 'GRE-Graduate Record Examinations美國研究生入學考試/資格考試，為美國教育測驗服務社ETS所研發、舉辦一套系統考試，採機上測驗、適性化測驗，GRE主要是用來檢測考生對於大學知識的吸收多寡，整體重視考生對於情境的理解能力、考生分析推理的能力。 \n', 'tags': '', 'url': 'GRE.html'}]};